import styles from "../styles/Sectionbody.module.css";

export default function SectionBody({ children, hover }) {
  return (
    <div className={styles["section-body"]}>
      {children}
      <style jsx>{`
        .section-body:hover {
          background-color: ${hover ? "#2eb6ad" : "#dee3e3"};
          border-bottom: ${hover ? "4px solid #29a39b" : "none"};
          color: ${hover ? "#ffffff" : "#20272f"};
        }
      `}</style>
    </div>
  );
}
